import React from 'react';
import './Form.css';

function Form() {
    return (
        <div className="card col-md-8">
            <div className="card-body">
        <form>
            <div class="form-group">
                <label for="formInputName">Name</label>
                <input type="Name" class="form-control" id="username" placeholder="Name"></input>
            </div>
            <div class="form-group">
                <label for="FormInputemail">Email address</label>
                <input type="email" class="form-control" id="email-address" placeholder="name@example.com"></input>
            </div>
            <div class="form-group">
                <label for="formInputComment">Comments</label>
                <textarea class="form-control" id="comment" rows="4"></textarea>
            </div>

            <button type="button" class="btn btn-primary">Primary</button>
        </form></div>
        </div>
    );
}

export default Form;
